import React from "react";
import LoadingBar from "../LoadingBar/LoadingBar";
import "./Test.css";

function Test() {
  const [barPercentage, setbarPercentage] = useState(2350);

  useEffect(() => {}, [barPercentage]);
  return (
    <div className="test">
      <LoadingBar
        min_progress="0"
        max_progress="6000"
        title="Temperature"
        done={barPercentage}
      />
    </div>
  );
}

export default Test;
